import React, { Component } from "react";

export class Achref extends Component {
  constructor() {
    super();
    this.state = {
      fullName: "achref",
    };
  }
  handleShowPerson = () => {
    this.setState({
      ...this.state,
      show: !this.state.show,
    });
  };
  render() {
    return (
      <div>
        <h1>Bonjour {this.state.fullName}</h1>
      </div>
    );
  }
}

export default Achref;
